Description:
The Department for Education (DfE) required the following renewals for a one (1) year period: 
1. Support & Maintenance for their exisiting ArcGIS Licences and; 
2. An Annual Subscription to ArcGIS Online. 
The Authority currently held a support and maintenance contract for their ArcGIS Licences which primarily supported the following areas: 
1. Supports users in troubleshooting software; 
2. Receives software updates and bug fixes and; 
3. Exploits the capabilities of the software owned by the Authority. 
The Authority also held an Annual Subscription for ArcGIS Online which supports the following areas: 
1. Hosts GIS products on the web and; 
2. Explores interactive GIS solutions for the Authority. 
The current Support and Maintenance and Annual Subscription for the Authority's ArcGIS licences expired on 23rd August 2016. The Authority were seeking a sole Supplier to provide the renewal of their Esri UK ArcGIS Support and Maintenance contract and annual ArcGIS Online Subscription. This will be for a one (1) year period, commencing 23rd August 2016 until 22nd August 2017.
